import { View, StyleSheet, Modal, Button, Text } from "react-native";
function onChange() {
  return (
    <View>
      <Modal animationType={fade}>
        <Text>HOLA</Text>
      </Modal>
    </View>
  );
}

const NoteModal = () => {
  return (
    <View>
      <Button onPress={onChange()}>HI</Button>
    </View>
  );
};

const styles = StyleSheet.create({
  button: {
    width: 100,
    height: 100
  }
});

export default NoteModal;
